import React, { useState } from "react";
import Sresult from "./Sresult";

const Search = () => {
  const [img, setImg] = useState("");

  const typing = (event) => {
    const data = event.target.value;
    setImg(data);
  };

  return (
    <>
      <div style={{ marginTop: "40px", textAlign: "center" }}>
        <input
          placeholder="Search Image"
          type="search"
          value={img}
          onChange={typing}
        />
      </div>
      {}
      <Sresult lol={img} />,
    </>
  );
};

export default Search;
